import React, { Component } from 'react';
import { Navbar, Nav, NavItem } from 'react-bootstrap';




class Kayitlogo extends Component {
    render() {
        return (
            <div className='kitapkayit'>
              <Navbar expasnd="lg" variant="light" bg="light">
  <Container>
    <Navbar.Brand href="#">Navbar</Navbar.Brand>
  </Container>
</Navbar>
            </div>
        )
    }
}
export default Kayitlogo;
